import {useState} from 'react';

function Search(){

    const [inputValue,setInputValue] = useState('');
    function handleChange(e){
        setInputValue(e.target.value);
    }



    return (
        <div className="App">
            <h4>{inputValue}</h4>
        <input onChange={handleChange}  type='text' />
        </div>
    )
}

export default Search;
